import '../../domain/entities/gift_item.dart';

class GiftModel extends Gift {
  const GiftModel({
    required super.id,
    required super.userId,
    required super.username,
    required super.userProfileImg,
    required super.location,
    required super.images,
    required super.name,
    required super.description,
    required super.criteria,
    required super.category,
  });

  factory GiftModel.fromMap(Map data) {
    return GiftModel(
      id: data['id'] ?? '',
      userId: data['userId'] ?? '',
      username: data['username'] ?? '',
      userProfileImg: data['userProfileImg'] ?? '',
      location: data['location'] ?? '',
      images: data['images'] ?? '',
      name: data['name'] ?? '',
      description: data['description'] ?? '',
      criteria: data['recipient_criteria'] ?? '',
      category: data['category'] ?? '',
    );
  }

  factory GiftModel.fromGift(Gift item) {
    return GiftModel(
      id: item.id,
      userId: item.userId,
      username: item.username,
      userProfileImg: item.userProfileImg,
      location: item.location,
      images: item.images,
      name: item.name,
      description: item.description,
      criteria: item.criteria,
      category: item.category,
    );
  }

  Map<String, dynamic> toMap() {
    return {
      'name': name,
      'categoryId': '23a91c00-af57-48ad-a5e7-a6959b1a3ccb',
      'description': description,
      'recipient_criteria': criteria,
      'location': location,
      'images': [
        {
          "fileName": "32342.png",
          "base64":
              ''''''
        },
        {
          "fileName": "43234.png",
          "base64":
              ''''''
        },
        {
          "fileName": "45342.png",
          "base64":
              ''''''
        }
      ],
    };
  }
}
